import React, { Component } from 'react';
import './ImageGallery.css';
import Slider from "react-slick";

class ImageGallery extends Component {
	render() {
    var settings = {
      dots: false,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <Slider {...settings}>

				<div>
					<div>Test1</div>
				</div>

				<div>
					<div>Test2</div>
				</div>

				<div>
					<div>Test3</div>
				</div>

      </Slider>
    );
  }
}

export { ImageGallery };
